       $(document).ready(function() {
         $('.datenai').on('input', function() {
           var input = $(this).val();
           
           // Remove all non-digit characters from the input
           var digitsOnly = input.replace(/\D/g, '');
           
           // Add slashes at the appropriate positions
           var formattedInput = '';
           if (digitsOnly.length > 4) {
             formattedInput += digitsOnly.substr(0, 2) + '/';
             formattedInput += digitsOnly.substr(2, 2) + '/';
             formattedInput += digitsOnly.substr(4);
           } else if (digitsOnly.length > 2) {
             formattedInput += digitsOnly.substr(0, 2) + '/';
             formattedInput += digitsOnly.substr(2);
           } else {
             formattedInput += digitsOnly;
           }
           
           // Update the input field with the formatted value
           $(this).val(formattedInput);
         });
       });
      </script>
